import { useRouter } from "next/router";
import { useEffect } from "react";

const Index = () => {
  const router = useRouter();
  useEffect(() => {
    // window.location.replace("/top");
    router.push("/top");
    console.log(Router);
  }, []);

  return <div>I am Index</div>;
};

export default Index;
